//SETTINGS VALUES
let notificationSettings = [
  {id:"toggleTable",rows:[
    {columns:[
      {
        label: "DMs"
      },
      {
        label: "Game Invites"
      },
      {
        label: "Friend Requests"
      },
      {
        label: "Game Mentions"
      }
    ]},
    {columns:[
      {
        id: "cdms",
        type: "checkbox"
      },
      {
        id: "cinv",
        type: "checkbox"
      },
      {
        id: "creq",
        type: "checkbox"
      },
      {
        id: "cmen",
        type: "checkbox"
      }
    ]},
    {columns:[
      {
        label: "Setting Changes"
      },
      {
        label: "Game Start"
      },
      {
        label: "Lobby Vote"
      },
      {
        label: "Ranked Countdown"
      }
    ]},
    {columns:[
      {
        id: "cset",
        type: "checkbox"
      },
      {
        id: "cstart",
        type: "checkbox"
      },
      {
        id: "cvote",
        type: "checkbox"
      },
      {
        id: "crank",
        type: "checkbox"
      }
    ]}
  ]}
];

var saveData = {
  'vol':0.15
};

//SAVING SETTINGS
function saveSettings() {
  localStorage.setItem("notificationSettings", JSON.stringify(saveData));
}

// load settings from local storage
function loadSettings() {
// load settings, if nothing is loaded, use default settings
  let loadedSettings = localStorage.getItem("notificationSettings");
  if (loadedSettings !== null) {
    saveData = JSON.parse(loadedSettings);
  }
}
function getSaveData(key, defaultvalue) {
  if(!saveData.hasOwnProperty(key)) return defaultvalue;
  return saveData[key];
}
function setSaveData(key, value) {
  saveData[key]=value;
  saveSettings();
}

function cookies2SavedData() {
  loadSettings();
  for(let table of notificationSettings) {
    for (let row of table.rows) {
      for (let column of row.columns) {
        if(column.type==="checkbox") {
          let value=Cookies.get(column.id);
          if(value!==undefined) {
            saveData[column.id]=value==="true";
            deleteCookie(column.id);
            console.log(column.id)
          }
        }
      }
    }
  }
  deleteCookie("vol");
  saveSettings();
}

function deleteCookie(key) {
  Cookies.set(key, "", { expires: 0 });
}

cookies2SavedData();

//GRAPHICS CONTAINERS
$("#settingsGameContainer").append($("<row id='volbox'><div style='text-align:center;padding-top:10px;padding-bottom:10px' id='soundSettingsTitle'><label>Notification Sound Settings</label></row>"));
$("#volbox").append("<div id='soundSettingsTable' style='width:100%;'></div>");
$("#soundSettingsTable").append("<div id='sliderBox' style='width:30%;height:50px;margin:auto;'></div>");
$("#soundSettingsTable").append("<div id='soundToggle' style='width:100%;'></div>");
$("#sliderBox").append("<input type='range' min='0' max='100' value='15' class='slider' id='volslid'><p style='text-align:center;padding-top:5px;'>Volume: <span id='outp'></span>%</p>");
$(".slider").css({"width":"100%","height":"10px","-webkit-appearance":"none","-moz-appearance":"none","outline":"none","padding-top":"0px","background":"#f8f8f8","border-radius":"5px"});

const addCSS=s=>((d,e)=>{(e=d.createElement("style")).innerHTML=s;d.head.appendChild(e)})(document);

addCSS('.slider::-webkit-slider-thumb {-webkit-appearance:none;appearance:none;border-style:none;width:20px;height:20px;background-color:#2e88d9;background-image:-webkit-linear-gradient(to bottom,#4497ea 0,#006ab7 100%);background-image:-o-linear-gradient(to bottom,#4497ea 0,#006ab7 100%);background-image:linear-gradient(to bottom,#4497ea 0,#006ab7 100%);cursor:pointer;border-radius:50%;}');
addCSS('.slider::-moz-range-thumb {width:20px;height:20px;border-style:none;background-color:#2e88d9;background-image:-webkit-linear-gradient(to bottom,#4497ea 0,#006ab7 100%);background-image:-o-linear-gradient(to bottom,#4497ea 0,#006ab7 100%);background-image:linear-gradient(to bottom,#4497ea 0,#006ab7 100%);cursor:pointer;border-radius:50%;}');

for(let table of notificationSettings) {
  $("#soundToggle")
    .append($("<table></table>")
    .attr("id", table.id)
    .attr("style","width:100%;")
  );
  for (let row of table.rows) {
    let tr=$("<tr></tr>");
    if(row.hasOwnProperty("height"))
      tr.attr("height",row.height);
    for (let column of row.columns) {
      let td=$("<td></td>");
      if(column.hasOwnProperty("width"))
        td.attr("width",column.width);
      else if(column.type=="checkbox"){
        td.attr("width","25%");
        let div=$('<div></div>');
        div.addClass("customCheckbox");
        let checkbox=$('<input type="checkbox" id="'+column.id+'">');
        checkbox.prop("checked", getSaveData(column.id, true));
        checkbox.click(function () {
          setTimeout(() => {
            let check=$("#"+column.id).prop("checked");
            setSaveData(column.id, check);
          },1);
        });
        div.append(checkbox);
        div.append($('<label for="'+column.id+'"><i class="fa fa-check" aria-hidden="true"></i></label>'));
        td.append(div);
      }
      else {
        if(column.hasOwnProperty("label"))
          td.text(column.label);
      }
      tr.append(td);
    }
    $("#"+table.id).append(tr);
  }
}

var slider=document.getElementById("volslid");
var output=document.getElementById("outp");
slider.onchange=updateVolume;

function updateVolume(){
    setSaveData('vol',slider.value/100);
    output.innerHTML=slider.value;
}

$(document).ready(function(){
    $("#volslid").val((getSaveData('vol',0.15))*100);
    updateVolume();
});

$('#volbox').on('wheel', function(e){
  if(e.originalEvent.deltaY<0){$("#volslid").val(parseInt(slider.value)+2);}
  else{$("#volslid").val(parseInt(slider.value)-2);}
  updateVolume();
});


//NOTIFICATION SOUNDS
if (!window.GameChat) return;
var set=new Audio("data:audio/mpeg;base64,");
var men=new Audio("data:audio/mpeg;base64,");
var dm =new Audio("data:audio/mpeg;base64,");
var inv=new Audio("data:audio/mpeg;base64,");
var start=new Audio("data:audio/mpeg;base64,");
var rank=new Audio("data:audio/mpeg;base64,");

new Listener("chat message", function (payload){
    if (getSaveData('cdms',true)){
      dm.volume=getSaveData('vol',0.15);
      dm.play()
    }
}).bindListener();
new Listener("game invite", function (payload){
    if (getSaveData('cinv',true)){
        inv.volume=getSaveData('vol',0.15);
        inv.play()
    }
}).bindListener();
new Listener("new friend request recived", function (payload){
    if (getSaveData('creq',true)){
        inv.volume=getSaveData('vol',0.15);
        inv.play()
    }
}).bindListener();
new Listener("Room Settings Changed", (payload) =>{
    if (getSaveData('cset',true)){
        set.volume=getSaveData('vol',0.15);
        set.play()
    }
}).bindListener();
new Listener("Game Chat Message", function (payload){
    if ((!socialTab.isBlocked(payload.sender))&&(getSaveData('cmen',true))){
        if (gameChat.atSelfRegex.test(payload.message)||payload.atEveryone){
            men.volume=getSaveData('vol',0.15);
            men.play();
        }
    }
}).bindListener();
new Listener("quiz ready", (payload) =>{
    if (getSaveData('cstart',true)){
        start.volume=getSaveData('vol',0.15);
        start.play()
    }
}).bindListener();
new Listener("battle royal ready", (payload) =>{
    if (getSaveData('cstart',true)){
        start.volume=getSaveData('vol',0.15);
        start.play()
    }
}).bindListener();
new Listener("return lobby vote start", (payload) =>{
    if (getSaveData('cvote',true)){
        start.volume=getSaveData('vol',0.15);
        start.play()
    }
}).bindListener();
new Listener("popout message", (payload) =>{
    if (payload.message.includes('Lobby can be joined')&&getSaveData('crank',true)){
        rank.volume=getSaveData('vol',0.15);
        rank.play()
    }
}).bindListener();


